# 码表的排序方式: by_weight 权重，original 原始顺序

# 码表内容格式：字词 键码  权重 （中间是tab，不是空格）
# '#'开头的只是注释， 注释只能另起一行写，不能在词条后面写
# `##` 两个 # 开头的会被识别为分组名，其后跟的词条就是该组的内容
# ------------------
# 王码86基础上修改,仅含单字。
# 1. 一二级简码出简不出全
#  一级或者二级简码的字,必须使用一级或者二级简码来打,比如: 工,只能通过单个a键来打,不能通过aaaa来打
#  也就是说,有一级或者二级简码的字,最多只能按一个键或者两个键就必须把字选出来,虽然五笔可以四键确认一个字
#  但,往后再按键,你想打的字就打不出来了
# 2. 有三级简码的四码重码字排在后面
# 比如:
#乍	thf
#乍	thfd
#怎	thfn
#迮	thfp
# 当输入thf时,只能打 乍 怎 迮 这3个字,但实际上thfd是乍的四码,必须按d才能单独显示乍
# 总结就是: 有三级简码(thf)的（乍）的四码重码（thfd）字排在后面

# 3. 增加“礼”的三级简码
# 4. 9354行编码，6238个字。231个重码字。

